import React from "react";
import custom from "./images/custom.jpg";

const KeepHeader = () => {
    return (
        <>
            <header>
                <img width = "80" height = "70" src = {custom} alt= "keepLogo"/>
            </header>
        </>
    );
}

export default KeepHeader;
